eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst messages = {\n    welcome: 'Welkom',\n    welcomeTo: 'Welkom bij',\n    mantleOfPraise: 'Mantel van lof',\n    home: 'Home',\n    joinUs: 'Word lid',\n    aboutUs: 'Over ons',\n    contact: 'Contact',\n    visitingAddressTitle: 'Bezoekadres',\n    mailingAddressTitle: 'Postadres',\n    chamberOfCommerceTitle: 'Kamer van Koophandel',\n    servicesTitle: 'Diensten',\n    servicesText: 'Elke eerste en derde zondag van de maand vinden de kerkdiensten op locatie plaats. Op zondagen zonder fysieke bijeenkomst worden de diensten via Zoom gehouden.',\n    contactTitle: 'Contact',\n    firstName: 'Voornaam',\n    lastName: 'Achternaam',\n    email: 'E-mailadres',\n    phone: 'Telefoonnummer',\n    city: 'Woonplaats',\n    church: 'Van welke kerk bent u lid?',\n    pastor: 'Naam van uw voorganger',\n    gifts: 'Gaven / Talenten',\n    agreeTerms: 'Ik ga akkoord met de algemene voorwaarden',\n    agreePrivacy: 'Ik ga akkoord met het privacybeleid',\n    submit: 'Lidmaatschapsformulier verzenden',\n    mustAgree: 'U moet met beide voorwaarden akkoord gaan om verder te gaan.',\n    socialMedia: 'Sociale media',\n    visitingAddress: 'Bezoekadres',\n    mailingAddress: 'Postadres',\n    kvk: 'Kamer van Koophandel',\n    footerText: 'Mijn God, ik roep des daags, en Gij antwoordt niet, en des nachts, en ik kom niet tot stilte. Nochtans zijt Gij de Heilige, die troont op de lofzangen Israëls. Op U hebben onze vaderen vertrouwd, zij hebben vertrouwd, en Gij deedt hen ontkomen;',\n    aboutUsText: 'De Geest van de Heere is op mij, want de HEERE heeft mij gezalfd om goede tijding te brengen aan de ootmoedigen, om de gebrokenen van hart te genezen, vrijheid uit te roepen voor gevangenen en opening van de gevangenis voor wie gebonden zijn; om het jaar van het welbehagen van de HEERE en de dag van de wraak van onze God te verkondigen; om allen die treuren te troosten, hun schoonheid voor as te geven, vreugde-olie voor rouw, en een kleed van lof voor een verslagen geest; opdat zij genoemd worden eiken van gerechtigheid, een planting van de HEERE, tot Zijn verheerlijking.',\n    aboutUsTextOnder: '- Jesaja 61:1-3',\n    firstService: 'Aanbidding en Aanbidders',\n    firstServiceText: 'Wij bieden een platform voor uw dienst als aanbidder in aanbiddingsbijeenkomsten',\n    secondService: 'Profetie en Profeten',\n    secondServiceText: 'Aanbidding en profetie vullen elkaar aan, en deze bediening biedt de basis voor de openbaring van profetie en de bediening van de profeten naast aanbidding.',\n    thirdService: 'Organiseren van gebeds- en aanbiddingssessies',\n    thirdServiceText: 'In Mantel van lof zijn de gebeds- en aanbiddingsbijeenkomsten een plaats waar harten in Gods aanwezigheid verenigd worden. Door muziek en aanbidding te combineren onder leiding van de Heilige Geest, en geïnspireerd door het Woord van God in 1 Samuël 10:5, bieden deze samenkomsten een gelegenheid voor het volk van God om Hem met één stem te verheerlijken.',\n    more: 'meer',\n    vision: 'Onze Visie',\n    visionText: 'Onze visie is het vormen van een inspirerende gemeenschap van aanbidders en profeten die, door middel van muziek en aanbidding vervuld met de leiding van de Heilige Geest, het licht en de aanwezigheid van God in kerken verspreiden, elk hart wekken en genezen, en een levendige, diepe en blijvende ervaring van verbinding met de Heer creëren voor elk individu en elke gemeente.',\n    giftText: 'Wij nodigen u uit om met een dankbaar hart en standvastig geloof deel te nemen, zodat de naam van de Heer onder de volken verheerlijkt wordt.',\n    gift: 'Gift',\n    giftTextbibel: 'Laat ieder zoveel geven als hij zelf besloten heeft, zonder tegenzin of dwang, want God houdt van mensen die blijmoedig geven.',\n    giftTextbibelOnder: '2 Korintiërs 9:7',\n    team: 'Ons Team',\n    teamText: 'At Mantel van lof, we are not just a team; we are a family. Together we worship, learn, serve, and grow. The leadership of this ministry is guided by the leadership team and the spiritual oversight of the Levites, but the truth is that we are all an essential part of the Mantel van lof family. Each of us serves in our place: the worship and music team, the training team, and those who organize meetings and events. Youth leaders also join us to prepare the next generation for the future. We believe: we are instruments of service, but growth and blessing come only from God.',\n    leader: 'Leiderschapsteam',\n    leaderText: 'Het Leiderschapsteam van Reda-ye Setayesh, bestaande uit dienaren met ervaring en een diepe toewijding aan aanbidding en kerkelijke bediening, is verantwoordelijk voor de leiding van alle geestelijke en praktische activiteiten van deze bediening. In overleg en onder geestelijk toezicht van de Levieten ontwikkelt en bevordert het beleid en programma’s, coördineert het de aanbiddings- en onderwijsteams, leidt het bijeenkomsten en evenementen, beheert het middelen en budgetten en ondersteunt en begeleidt het de leden van de bediening, om zo een gezonde, geestelijke en creatieve omgeving voor aanbidding en geloofsgroei te scheppen.',\n    ourMission: 'Onze Missie',\n    ourMissionText: 'Wij geloven dat aanbidding en gebed de taal van de hemel zijn en een weg om het hart van God te kennen. Ons doel is dat gelovigen door aanbidding en gebed in geloof verenigd worden en met één stem de Heer verheerlijken. Onze visie en missie is de eenheid van gelovigen in de geest van aanbidding. Wij verlangen dat het volk van God vernieuwd wordt in Zijn aanwezigheid en toegerust met Zijn kracht en sterkte om hun goddelijke opdracht in deze wereld te volbrengen—een opdracht waarin het licht van Christus weerspiegeld wordt in het persoonlijke leven, in de kerk en in de samenleving.',\n    aboutUsShortText: 'Wij zijn meer dan een team; wij zijn een familie die samen aanbidt, leert en dient.',\n    aboutUsSectionText: 'Mantel van lof was born out of prayer, the guidance of the Holy Spirit, and a deep passion for worship. The founders, together with their families and with years of experience in worship and church ministry, established this ministry to be a place where the presence of God can be encountered, where spiritual growth takes place, and where churches—both Persian-speaking and international—are served. Time and again, we have experienced the power of true worship; a worship that renews hearts, transforms lives, and builds up the church.',\n    sima: 'Dr. Sima Sasanfar',\n    chairperson: 'Voorzitter',\n    hamid: 'Hamid Ghanbari',\n    secretary: 'Secretaris',\n    alireza: 'Alireza Shayan',\n    atena: 'Atena Gholami',\n    homa: 'Homa Mohammadi',\n    Kazem: 'Herder Kazem Dehghani',\n    treasurer: 'Penningmeester',\n    babak: 'Herder Babak Zeynali',\n    kamil: 'Dominee Kamil Navai',\n    advisoryBoardMember: 'Adviseurend',\n    supervisoryCommission: 'Toezichtscommissie',\n    supervisoryCommissionText: 'De Toezichtscommissie van de organisatie Reda-ye Setayesh bestaat uit Levieten van aangesloten kerken. Haar taak is het toezien op de geestelijke integriteit van de organisatie, het bieden van pastorale en geestelijke ondersteuning aan de leden en activiteiten, en het waarborgen dat de organisatie handelt binnen bijbelse principes.',\n    ANBIInformation: 'ANBI Informatie',\n    ourVision: 'Onze Visie',\n    ourVisionText: 'Onze visie is het ervaren van ware eenheid in de aanbidding van de Heer; een plaats waar harten, stemmen en levens in Zijn aanwezigheid één worden. Wij geloven dat de taal van de hemel niets anders is dan eenheid in aanbidding, en wanneer het volk van God met één hart Hem aanbidt, wordt Zijn aanwezigheid geopenbaard en wordt de hemel op aarde weerspiegeld. Onze visie is het zien van een generatie die in de liefde en aanbidding van Christus verenigd is en samen Zijn naam verheerlijkt.',\n    beleidsplanTitle: 'Beleidsplan Stichting Mantle of Praise',\n    // Section 1 – Goals\n    policyGoalsTitle: '1. Doelstelling van de instelling',\n    policyGoalsIntro: 'De organisatie Stichting Mantle of Praise heeft als doel:',\n    policyGoals1: 'Het bevorderen van christelijke aanbidding en geestelijke vorming.',\n    policyGoals2: 'Het opleiden en begeleiden van aanbidders, muzikanten en geestelijke leiders.',\n    policyGoals3: 'Het ondersteunen van kerken en christelijke gemeenschappen door middel van aanbidding, onderwijs en samenwerking.',\n    // Section 2 – Activities\n    policyActivitiesTitle: '2. Activiteiten om dit doel te bereiken',\n    policyActivities1: 'Het organiseren van aanbidding bijeenkomsten, conferenties en trainingen.',\n    policyActivities2: 'Het ontwikkelen en beschikbaar stellen van liederen, materialen en hulpmiddelen voor aanbidding.',\n    policyActivities3: 'Het geven van onderwijs en begeleiding aan leden en deelnemers.',\n    policyActivities4: 'Het bevorderen van samenwerking tussen kerken en christelijke organisaties.',\n    // Section 3 – Income\n    policyIncomeTitle: '3. Inkomstenbronnen',\n    policyIncomeIntro: 'De inkomsten van de organisatie bestaan uit:',\n    policyIncome1: 'Vrijwillige bijdragen en donaties van particulieren en kerken.',\n    policyIncome2: 'Collecten en giften tijdens bijeenkomsten en evenementen.',\n    policyIncome3: 'Eventuele bijdragen van samenwerkende organisaties of fondsen.',\n    // Section 4 – Expenses\n    policyExpensesTitle: '4. Besteding van de middelen',\n    policyExpensesIntro: 'De bestedingen van de organisatie zijn gericht op:',\n    policyExpenses1: 'Het organiseren van activiteiten en evenementen.',\n    policyExpenses2: 'Onderwijs, training en begeleiding van leden en deelnemers.',\n    policyExpenses3: 'Aanschaf van muziekinstrumenten, apparatuur en materialen.',\n    policyExpenses4: 'Ondersteuning van kerken en bedieningen.',\n    policyExpenses5: 'Algemene beheers- en organisatiekosten.',\n    // Section 5 – Asset Management\n    policyAssetsTitle: '5. Beheer van het vermogen',\n    policyAssetsText: 'Het vermogen van de organisatie wordt zorgvuldig en transparant beheerd door het bestuur, conform de statuten en onder toezicht van de penningmeester en de commissie met toezicht. De middelen worden uitsluitend besteed aan de verwezenlijking van de doelstellingen.',\n    ourVisionTitle: 'Onze Visie',\n    unityPrayerWorshipTitle: 'Eenheid in gebed en ware aanbidding',\n    unityPrayerWorshipIntro: 'Het christelijk geloof is niet slechts een individueel geloof. Vanaf het begin van de Bijbel verzamelt God Zijn volk om Hem samen te aanbidden. Ware aanbidding wordt krachtiger wanneer gelovigen hun hart en geest verenigen.',\n    godThroneTitle: 'God gezeten op de troon door lof van Zijn volk',\n    godThroneText: \"Psalm 22:3: 'Maar U bent heilig, gezeten op de lof van Israël.' Wanneer Gods volk samen hun stemmen verheft, zet Hij Zich op hun aanbidding en wordt Zijn aanwezigheid op aarde zichtbaar.\",\n    godsThroneAmongPeopleTitle: 'De troon van God onder Zijn volk',\n    godsThroneAmongPeopleText: \"Jeremia 49:38: 'Ik zal Mijn troon daar vestigen.' Wanneer we verenigd zijn in gebed en aanbidding, wordt Gods troon gevestigd en wordt Zijn autoriteit zichtbaar in onze kerk.\",\n    godsTempleTitle: 'Wij zijn Gods tempel',\n    godsTempleText: \"1 Korintiërs 3:16: 'Weet u niet dat u Gods tempel bent en dat Gods Geest in u woont?' Elke gelovige is een levende tempel, en samen vormen we een grotere tempel waar Gods aanwezigheid zichtbaar wordt.\",\n    worshipSpiritTruthTitle: 'Aanbidden in Geest en Waarheid',\n    worshipSpiritTruthText: 'Johannes 4:20-23: Ware aanbidders zullen de Vader aanbidden in geest en waarheid. Ware aanbidding vindt plaats wanneer ons hele wezen in lijn is met Gods waarheid.',\n    applicationTodayTitle: 'Toepassing voor Vandaag',\n    applicationTodayText: 'Handelingen 2:46-47: Wanneer ons gebed en aanbidding verenigd zijn, komt Gods aanwezigheid op een frisse manier, wordt de vijand verslagen, groeit ons geloof sterker en zien anderen Gods glorie en worden tot Christus getrokken.'\n};\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (messages);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./i18n/nl.js\n");

